import { Link, Outlet } from 'react-router-dom';

import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <Link to="home">Home</Link>
      <Link to="question">Question</Link>
      <Link to="send-code">Send Code</Link>
      <Link to="success">Success</Link>
      <Link to="already-sent">Already Sent</Link>
      <Outlet />
    </div>
  );
}

export default App;
